function openWechatLayerFooter(){
	$('#wechat-pop-footer').css('display', 'block');
}
function closeWechatLayerFooter(){
	$('#wechat-pop-footer').css('display', 'none');
}
function openWechatLayerPage(url, title){
	$('#wechat-pop-page.wechat-pop').css('display', 'block');
	
	document.getElementById("qr-img-content").innerHTML="";
	var qrcode = new QRCode(document.getElementById("qr-img-content"), {
		width : 148,
		height : 148
	});
	qrcode.clear();
	qrcode.makeCode(url);
}
function closeWechatLayerPage(){
	$('#wechat-pop-page.wechat-pop').css('display', 'none');
}


